import React, { useState, useEffect } from "react";
import { Card, Table, Pagination } from "react-bootstrap";
import axios from "axios";
import { Link } from "react-router-dom";

const DesignData = () => {
  const [designPaths, setDesignPaths] = useState([]);
  const [designVariables, setDesignVariables] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(15);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const pathsResponse = await axios.get("http://localhost:5000/design-paths");
      const variablesResponse = await axios.get("http://localhost:5000/design-variables");
      setDesignPaths(pathsResponse.data);
      setDesignVariables(variablesResponse.data);
    } catch (error) {
      console.error(error);
    }
  };

  // Get current items
  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentDesignPaths = designPaths.slice(indexOfFirstItem, indexOfLastItem);
  const currentDesignVariables = designVariables.slice(indexOfFirstItem, indexOfLastItem);

  // Change page
  const handlePageChange = (pageNumber) => {
    setCurrentPage(pageNumber);
  };

  return (
    <Card className="col-7 mt-3" style={{ margin: "auto", background: "#dbd7d7", minHeight: "0" }}>
      <Card.Header>
        <Card.Title className="display-6">Design Data</Card.Title>
      </Card.Header>
      <Card.Body style={{ overflowY: "auto", maxHeight: "calc(100vh - 350px)" }}>
        <div style={{ display: "flex", justifyContent: "flex-end" }}>
          <Link to="/view-data">
            <button
              style={{
                background: "#2B4D9D",
                border: "none",
                borderRadius: "10px",
                marginTop: "2px",
                height: "40px",
                color: "white",
              }}
            >
              View Design Data
            </button>
          </Link>
        </div>

        <h2>Design Paths</h2>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>defDirectory</th>
              <th>lefDirectory</th>
              <th>libDirectory</th>
              <th>techDirectory</th>
            </tr>
          </thead>
          <tbody>
            {currentDesignPaths.map((design) => (
              <tr key={design._id}>
                <td>{design.defDirectory}</td>
                <td>{design.lefDirectory}</td>
                <td>{design.libDirectory}</td>
                <td>{design.techDirectory}</td>
              </tr>
            ))}
          </tbody>
        </Table>

        <h2>Design Variables</h2>
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>design</th>
              <th>num_cpu</th>
              <th>power_opt</th>
              <th>gen_eff</th>
            </tr>
          </thead>
          <tbody>
            {currentDesignVariables.map((variable) => (
              <tr key={variable._id}>
                <td>{variable.design}</td>
                <td>{variable.num_cpu}</td>
                <td>{variable.power_opt ? "True" : "False"}</td>
                <td>{variable.gen_eff}</td>
              </tr>
            ))}
          </tbody>
        </Table>

        {/* Pagination */}
        <div className="d-flex justify-content-center">
          <Pagination>
            {Array.from({ length: Math.ceil(designPaths.length / itemsPerPage) }, (_, index) => (
              <Pagination.Item
                key={index + 1}
                active={index + 1 === currentPage}
                onClick={() => handlePageChange(index + 1)}
              >
                {index + 1}
              </Pagination.Item>
            ))}
          </Pagination>
        </div>
      </Card.Body>
    </Card>
  );
};

export default DesignData;
